(73, 2, 4, 'BOE-404 CSDS', 'Energy Science & Engineering', 'Explain the fundamental concepts of various types of energy measurements, conversion, and its applications.', 'Apply the concept of quantum physics for the generation of nuclear energy along with reactor design aspects and safety measures.', 'Apply the concepts and characteristics of Solar Energy and solar cell for various applications.', 'Make use of various conventional & non-conventional energy sources & its conversion into useful form.', 'Illustrate the global energy scenario along with various energy storage devices and conservation concepts.', NULL),
(74, 2, 4, 'BAS-401 CSDS', 'Technical Communication', 'Understand the concepts of technical communication which will help them grow and emerge as better professionals.', 'Develop an understanding of tools necessary for writing effective required while drafting technical & professional documents.', 'Utilize technical writing skills necessary to demonstrate their ability to use organizational formats with a clear specific purpose, deliver effective speeches that are consistent with and appropriate for the audience and purpose.', 'Integrate various dimensions of communication skills which will further make the transition from student to a professional smoother and help them excel in their jobs.', 'Equip students with the technology-enabled communication tools and help them grow in various spheres of professional arena.', NULL),
(75, 2, 4, 'BCS-402 CSDS', 'Theory of Automata and Formal Languages', 'Analyse and design finite automata, pushdown automata, Turing machines, formal languages, and grammars.', 'Analyse and design Turing machines, formal languages, and grammars.', 'Demonstrate the understanding of key notions, such as algorithm, computability, decidability, and complexity through problem solving.', 'Prove the basic results of the Theory of Computation.', 'State and explain the relevance of the Church-Turing thesis.', NULL),
(76, 2, 4, 'BCC-401 CSDS', 'Cyber Security', 'Understand the basic concepts of cyber security and cybercrimes.', 'Understand the security policies and cyber laws.', 'Understand the tools and methods used in cybercrime.', 'Understand the concepts of cyber forensics.', 'Understand the cyber security policies and cyber laws.', NULL),
(77, 2, 4, 'BCS-403 CSDS', 'Object Oriented Programming with Java', 'Develop the object-oriented programming concepts using Java.', 'Implement exception handling, file handling, and multi-threading in Java.', 'Apply new java features to build java programs.', 'Analyse java programs with Collection Framework.', 'Test web and RESTful Web Services with Spring Boot using Spring Framework concepts.', NULL),
(78, 2, 4, 'BCS-401 CSDS', 'Operating System', 'Explain the main components, services, types, and structure of Operating Systems.', 'Apply the various algorithms and techniques to handle the various concurrency.', 'Compare and apply CPU scheduling techniques and identify a deadlock and recommend solutions.', 'Explain and apply various memory management schemes.', 'Explain and apply I/O and disk management techniques.', NULL),
(79, 2, 4, 'BCS-451 CSDS', 'Operating System Lab', 'To compare various CPU scheduling algorithms through simulation.', 'To simulate various synchronization algorithms to achieve mutual exclusion using Semaphores.', 'Simulate paging technique for memory management.', 'To simulate resource acquisition and release for deadlock handling.', 'Simulate various disk scheduling algorithms.', NULL),
(80, 2, 4, 'BCS-452 CSDS', 'Object Oriented Programming with Java Lab', 'Implement object oriented concepts such as objects, class abstraction and message passing.', 'Implement the friend function and function overloading.', 'Implement Operator overloading, Inheritance and method overriding.', 'Implement virtual function to achieve Run time polymorphism.', 'Implement the various functions on String, Apply I/O operation to handle file system.', NULL),
(81, 2, 4, 'BCS-453 CSDS', 'Cyber Security Workshop', 'Implement network traffic analysis and sniffing using Wireshark.', 'Implement vulnerability detection and exploitation of web applications.', NULL, NULL, NULL, NULL);
